import "./styles/App.css";
import Header from "./components/Header";
import Maps from "./components/Maps";
import { useEffect } from "react";
function App() {
  useEffect(() => {
    fetch("/")
      .then((res) => {
        return res.json();
      })
      .then((data) => {
        console.log(data);
      });
  }, []);
  return (
    <>
      <Header />
      <Maps />
    </>
  );
}

export default App;
